import contactus_image from "../images/contactus.jpeg";

const ContactUs = () => {
  return (
    <div>
      <div class="card" style={{ width: "18rem" }}>
        <img src={contactus_image} class="card-img-top" alt="about_us_pic" />
        <div class="card-body">
          <h5 class="card-title">Contact Us</h5>
          <p class="card-text">
            <b>Contact No:</b> +91 8767663594
            <b>Email Id:</b> mjmuradali31@gmail.com
          </p>
        </div>
      </div>
    </div>
  );
};

export default ContactUs;
